/*
*           --------------------- COMPANY ------------------
*/

create table company (
	id INT,
	name VARCHAR(50),
	country VARCHAR(50),
	headquarters VARCHAR(50),
	is_active INT
);



/*
 *           ----------------- AIRPORT---------------------------------
*/


create table airport (
	id INT,
	name VARCHAR(50),
	city VARCHAR(50),
	country VARCHAR(50),
	is_active INT
);


/*
 *           ----------------- Plane---------------------------------
*/

create table plane (
	id INT,
	model VARCHAR(50),
	registration_id VARCHAR(40),
	company_id_id INT,
	nr_sits INT,
	is_active INT
);


